  \"Multi-Purpose Anthropomorphic Robotic Hand Design for Extra-Vehicular Activity
  Manipulation Tasks using Embedded Fiber Optic Sensors Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T03:51:17.621138\",\n\t\"name\": \"multi-purpose-anthropomorphic-robotic-hand-design-for-extra-vehicular-activity-manipulatio\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"IFOS proposes to design and build fiber-optically
  sensorized robotic fingers that can sense force and, objects using only tactile
  feedback, similar to the skin on a human hand. The innovation, employing fiber optic
  sensors, will b integrate the highest-density EMI-immune optical sensing for robotic
  hand systems to enable human-like tactile sensing capabilities.  The innovative
  high-density manipulative system will add great dexterity to robotic hands and will
  be fully adaptable to performing complex Extravehicular tasks. In Phase I, IFOS
  will design a robotic hand and fingers system, focusing on the skin and muscle hardware
  requirements for tactile and force feedback information to be relayed to a central
  processor, which will then identify objects based on tactile feedback and provide
  a full haptic sense.  A proof-of concept experiments planned for Phase I will demonstrate
  gripping and grasping using a sub-scale sensorized set of fingers. Results will
  be used as input for prototype planned for Phase II, along with preliminary test
  and evaluation recommendations for potential insertion into an advanced Robonaut
  servicer.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
